CAIRO, Dec 19 (APP): Deputy Prime Minister and Foreign Minister Senator Mohammad Ishaq Dar on Thursday met with the Deputy Prime Minister and Foreign Minister of Azerbaijan Jeyhun Bayramov on the sidelines of 11th Summit of Developing Eight Countries, being held in Cairo.
During the meeting, they discussed bilateral cooperation between Pakistan and Azerbaijan and projects for regional connectivity.
